import api from "./baseApi";

export const levelApi = {
  getLevels(params, cancelToken) {
    return api.get("/api/level", { params, cancelToken });
  },
  postLevel(payload) {
    return api.post("/api/level", payload);
  },
  putLevel(id, payload) {
    return api.put(`/api/level/${id}`, payload);
  },
  deleteLevel(levelId) {
    return api.delete(`/api/level/${levelId}`);
  },
};
